import React from "react";
import { Link } from "react-router-dom";

const Nav = ({dogs})=> {
    return (
        <nav className="Nav">
            <Link to="/dogs">Dog List</Link>
            ·
            {dogs.map((dog)=> (
                <Link to={`/dogs/${dog.name}`}>
                    {dog.name} ·
                </Link>
            ))}
        </nav>
    )
};

export default Nav;
